-- Minimum participation ckeck on : IAO_0000032_IAO_0000004_double
CREATE OR REPLACE FUNCTION "ENVO"."IAO_0000032_IAO_0000004_double_checkParticipationMin"("_IAO_0000032_uid" "ENVO"."uid_domain")
  RETURNS BOOLEAN AS
$$
BEGIN
  IF
  (
    (
      SELECT COUNT(*)
      FROM "ENVO"."IAO_0000032_IAO_0000004_double"
      WHERE "IAO_0000032_uid" = "_IAO_0000032_uid"
    ) >= 1
  )
  THEN
    RETURN TRUE;
  ELSE
    RAISE NOTICE 'Participation  %  does not respect minimum value %', 'IAO_0000032_IAO_0000004_double', 1;
    RETURN FALSE;
  END IF;
END;
$$
LANGUAGE 'plpgsql';

